




박경귀 아산시장의 지명을 받아 챌린지에 참여한 신상진 시장은 이날 ‘우리 수산물로 식탁을 풍요롭게’라는 문구와 함께 촬영한 인증사진을 개인 사회관계망서비스(SNS)에 게재했다.

신상진 시장은 “이번 챌린지가 우리 수산물에 대한 국민들의 불안을 해소하고 어려움을 겪고 있는 수산업 종사자들에게 힘이 되길 바란다”고 말했다.

신 시장은 다음 챌린지 주자로 원강수 원주시장을 지명했다.

챌린지는 지난 7월 우리 수산물 소비촉진 장려를 통한 어촌 경제 활성화를 위해 ‘우리바다 지키기 검증 태스크포스(TF)’와 해양수산부가 공동 제안해 시작된 캠페인이다.
현재 각계각층의 인사들이 적극적으로 참여하고 있으며, 수산물 소비를 장려하는 문구와 함께 촬영한 사진을 SNS에 홍보하고 다음 릴레이 주자를 추천하는 방식으로 진행된다.

