25일 제주특별자치도에 따르면 수산물 안전·신뢰성 확보에 만전을 기하고 수산물 소비촉진을 위한 다양한 지역축제를 지원하고 있다.

도는 지난 6~8일 서귀포 은갈치 축제와 추자도 참굴비 대축제(13~15일), 광어축제(14~22일)를 지원한데 이어 다음달 4~5일 한림수협 FPC 수산물축제와 다음달 23~26일 방어축제를 진행한다. 최남단 모슬포 방어축제의 경우 한달여 하던 축제기간을 4일동안 짧고 굵게 열릴 예정인 것으로 알려졌다. 이들 축제현장에선 시중가보다 평균 30%이상 할인 판매한다.

특히 오는 29일까지 ‘대한민국 수산대전-가을 특별전’이 온라인몰에서 열려 최대 60%까지 할인된 가격에 국내산 수산물을 구입할 수 있다. 온누리상품권 상시 환급행사도 오는 12월 15일까지 지속된다.

도는 지난 추석연휴기간 약 15일동안 온누리상품권 환급액이 6억원을 기록했다. 도는 동문재래시장, 동문수산시장, 서귀포매일올레시장 등에서 수산물을 구매하면 일정금액(5만원 이상 구입땐 2만원 환급)을 온누리상품권으로 환급해주는 할인행사를 진행했다. 도는 재래시장에서 20억원의 수산물을 판매한 것으로 분석했다.
현재 일본정부는 1,2차에 걸쳐 총 1만 5600t을 방류했으며 내년 3월까지 3만 1200t을 방류할 예정인 것으로 파악됐다.

도는 일본 후쿠시마 원전 오염수 해양 방류에 대응해 도민 불안 해소와 어업인 피해 최소화를 위한 생산 및 유통단계 수산물 방사능 검사 결과 모두 적합 판정을 받았다. 지난 14~20일 생산단계 수산물 방사능 검사는 총 17건(올해 누적 277건)이며, 검사 결과 모두 기준에 적합했다. 같은 기간 유통단계 수산물 방사능 검사는 총 1건(올해 누적 177건)으로 적합으로 판정됐다.

지난 20일 기준 생산단계 수산물 59건(누적 8672건), 유통단계 수산물 103건(누적 6175건)이 적합 판정을 받았으며 일본산 수입수산물 26건(누적 4063건)이 적합으로 판정됐다. 일본수산물의 경우 후쿠시마 인근 8개현 수산물 수입은 전면 금지되고 있으나 그외 지역 수산물은 수입되고 있다.

정재철 제주도 해양수산국장은 “수산물 가공업체는 15%이상 판매량이 증가하고 대형마트에서는 30% 이상 판매량이 증가했다”면서 “수산물 소비촉진 행사를 지속적으로 진행해 소비자들에게 청정제주의 안심 수산물을 널리 알리고, 어업인과 소상공인들은 피해 최소화로 경영안정을 찾을 수 있도록 최선을 다하겠다”고 말했다.

한편 정부는 일본 공해상 방사능 조사를 실시한 결과 세계보건기구(WHO)의 먹는물 기준과 비교해 낮은 수준으로 확인됐으며, 연내에 수산물 대상 삼중수소 검사 기준과 시험법을 마련해 검사를 시작할 것이라고 밝혔다.

