부산 서구는 오는 27~29일 송도해수욕장 일원에서 \'제14회 부산고등어축제\'를 개최한다고 25일 밝혔다.

\'젊은 축제, 안심·안전 축제, 친환경 축제\'를 주제로 한 이번 축제는 갈수록 늘고 있는 가족 단위 방문객과 젊은 세대를 위한 다양한 프로그램으로 구성된다.

공연 프로그램은 가수 김범룡, 양지원, 오로라 등의 축하 무대와 체코세베라첵 합창단의 공연, 거리예술 공연 등이 있다.

고등어를 주제로 한 ▲카약 타고 고등어 찾기 ▲고등어 깜짝 경매 ▲고등어 쿠킹 클래스 ▲고등어 장학 퀴즈 등의 프로그램도 마련된다.

이외에도 힐링 바다 요가 클래스, 송도 바다 멍때리기 대회, 모래성 땅따먹기 등의 행사도 진행된다.

축제 기간 운영되는 수산물 상생 할인 직거래장터에서는 수량 제한 없이 사용 가능한 상생할인쿠폰(1만원 당 2000원 할인)을 제공할 예정이다.


