INSERT INTO bleuauction.ba_notice (notice_no, member_no, notice_title, notice_content, reg_datetime, mdf_datetime, notice_status) VALUES (1, 31, '이마트, 남해안 생굴 등 제철 수산물 최대 50% 할인 판매', '(서울=연합뉴스) 전성훈 기자 = 이마트는 오는 26일부터 일주일간 남해안 생굴 250ｇ(봉)을 신세계포인트 적립 시 50% 할인 판매한다고 25일 밝혔다.', '2023-10-25 20:42:05', '2023-10-25 14:33:05', 'N');
INSERT INTO bleuauction.ba_notice (notice_no, member_no, notice_title, notice_content, reg_datetime, mdf_datetime, notice_status) VALUES (2, 31, '신상진 성남시장, ‘수산물 소비·어촌휴가 장려 챌린지’ 동참', '신상진 경기 성남시장이 지난 24일 ‘수산물 소비·어촌휴가 장려 챌린지’ 캠페인에 동참했다.
INSERT INTO bleuauction.ba_notice (notice_no, member_no, notice_title, notice_content, reg_datetime, mdf_datetime, notice_status) VALUES (3, 31, '세종시의회 의장, 시장 겨냥 “尹정부 따라 日 수산물 미온적 대응” 성토', '[세종=뉴시스]송승화 기자 = 일본 후쿠시마 오염수 재방류로 수산물 안전에 국민적 우려가 다시 높아진 가운데 이순열 세종시의회 의장이 먹거리 안전에 세종시가 안이하게 대응한다며 강하게 비판했다.
INSERT INTO bleuauction.ba_notice (notice_no, member_no, notice_title, notice_content, reg_datetime, mdf_datetime, notice_status) VALUES (4, 31, '축제장 가면 30% 이상 할인… “제주 수산물 안심하고 드십써”', '제주도가 후쿠시마 원전 오염수 방류에 대응해 도민불안을 해소하고 수산물 소비 촉진을 위한 지역축제 지원에 발벗고 나섰다.
INSERT INTO bleuauction.ba_notice (notice_no, member_no, notice_title, notice_content, reg_datetime, mdf_datetime, notice_status) VALUES (5, 31, '\'공연부터 수산물 할인까지\' 부산 서구서 고등어축제 개최', '[부산=뉴시스]김민지 기자 = 볼거리, 즐길 거리와 함께 수산물 할인까지 받을 수 있는 \'제14회 부산고등어축제\'가 오는 27~29일 열린다.
INSERT INTO bleuauction.ba_notice (notice_no, member_no, notice_title, notice_content, reg_datetime, mdf_datetime, notice_status) VALUES (6, 31, '백성현 논산시장, ‘수산물 소비 촉진 캠페인 챌린지’ 동참', '다음 주자로 김동일 보령시장, 최재구 예산군수 지목
INSERT INTO bleuauction.ba_notice (notice_no, member_no, notice_title, notice_content, reg_datetime, mdf_datetime, notice_status) VALUES (7, 31, '부산시 특사경, 농축수산물 불법행위 집중 단속', '부산시 특별사법경찰과가 오는 11월 한달간 농축수산물 관련 식품 전반의 불법행위에 대해 특별 단속에 나섭니다.
INSERT INTO bleuauction.ba_notice (notice_no, member_no, notice_title, notice_content, reg_datetime, mdf_datetime, notice_status) VALUES (8, 31, '청주시, 청주 농·수산물 도매시장 이전 예정지에 유수지 조성', '충북 청주시는 청주 농·수산물 도매시장 이전 예정지인 흥덕구 옥산면 지역에 \'옥산면 도매시장 일원 유수지 조성사업\'을 추진한다고 25일 밝혔다.
INSERT INTO bleuauction.ba_notice (notice_no, member_no, notice_title, notice_content, reg_datetime, mdf_datetime, notice_status) VALUES (9, 31, '시흥 오이도항서 수산물 사면 하루 1인당 최대 3만원 환급', '경기도와 시흥시는 오는 27일부터 29일까지 사흘 동안 시흥 오이도항 수산물직판장에서 ‘수산물 소비촉진 행사’를 연다고 24일 밝혔다. 이번 행사는 경기도와 경기도 농수산진흥원, 시흥시 등이 공동 개최한다.
INSERT INTO bleuauction.ba_notice (notice_no, member_no, notice_title, notice_content, reg_datetime, mdf_datetime, notice_status) VALUES (10, 31, '김종식 창녕교육장 "우리 수산물 안심하고 드세요"', '[창녕=뉴시스] 안지율 기자 = 경남 창녕교육지원청은 25일 김종식 교육장이 수산물 소비촉진과 어촌경제 활성화를 위해 진행되는 수산물 소비촉진 캠페인 챌린지에 동참했다고 밝혔다.
